import { Layout } from "./components/Layout.jsx";
import { MainPage } from "./components/MainPage.jsx";
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Layout>
      <Routes>
        <Route path='/' element={<MainPage/>} />
      </Routes>
    </Layout>
  );
}

export default App;
